header h1 {
  padding: 10px;
  text-align: center;
  font-size: 5rem;
  background: #130b38;
  color: #eeeeee;
}

.location__wrapper {
  margin: 20px 0;
  text-align: center;
}
.location__wrapper #location {
  width: 400px;
  height: 50px;
  font-size: 2rem;
  border: none;
  border: 3px solid blue;
  background: #2b0db3;
  border-radius: 25px;
  color: white;
}
.location__wrapper #location:hover {
  background: #24bbd6;
}

.location__details {
  display: grid;
  grid-template-columns: 1fr 1fr;
}
.location__details .latitude {
  font-size: 40px;
  text-align: right;
  padding: 5px 10px;
}
.location__details .longitude {
  font-size: 40px;
  padding: 5px 10px;
}

#map {
  width: 100px;
  height: 100px;
}
